package com.github.vcvitaly._242;

import java.util.stream.Stream;
import lombok.AllArgsConstructor;
import lombok.Data;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.MethodSource;

import static org.assertj.core.api.Assertions.assertThat;

/**
 * ValidAnagramTest.
 *
 * @author Vitalii Chura
 */
class ValidAnagramTest {

    private ValidAnagram validAnagram = new ValidAnagram();

    @ParameterizedTest
    @MethodSource("params")
    void checksIfTIsAnAnagramOfS(Param p) {
        System.out.println(p);

        assertThat(validAnagram.isAnagram(p.s, p.t)).isEqualTo(p.isAnagram);
    }

    static Stream<Param> params() {
        return Stream.of(
                Param.of("anagram", "nagaram", true),
                Param.of("rat", "car", false),
                Param.of(
                        "",
                        "",
                        true
                ));
    }

    @Data
    @AllArgsConstructor(staticName = "of")
    private static class Param {
        private String s;
        private String t;
        private boolean isAnagram;
    }
}